import { Tab, Nav } from "react-bootstrap";
import "./SideBar.css";
const SideBar = () => {
  return (
    <div style={{ width: "250px" }} className="d-flex flex-column">
      <Tab.Container></Tab.Container>
    </div>
  );
};

export default SideBar;
